import './App.css';
import LandingPage from '../src/pages/landing/landing.js';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { useState } from 'react';

function App() {
  return (
    <div className="App">
   <Router>
      <Routes>
        <Route path="/" element={<LandingPage/>} />
        /* Other routes go here */
      </Routes>
    </Router>
    </div>
  );
}

export default App;
